import React, { Component } from 'react';

import { 
    DefaultPalette, 
    Stack, 
    IStackStyles, 
    IStackTokens 
} from 'office-ui-fabric-react';

const stackStyles: IStackStyles = {
    root: {
      background: '#fff2ff',
      height: '64px'
    },
  };

  const horizontalGapStackTokens: IStackTokens = {
    childrenGap: 10,
    padding: 10,
  };

  const itemStyles: React.CSSProperties = {
    alignItems: 'center',
    background: '#235233',
    color: '#235233',
    display: 'flex',
    justifyContent: 'center',
  };

class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav>
                <Stack horizontal styles={stackStyles} tokens={horizontalGapStackTokens}>
                    <span styles={itemStyles}>Home</span>
                    <Stack.Item>People</Stack.Item>
                    <Stack.Item>About</Stack.Item>
                    <Stack.Item>Blog</Stack.Item>
                </Stack>
            </nav>
        )
    }
}

export default Navbar;
